snippet.sync_client:
package com.example.usage;

import com.seed.builderExtension.BaseClient;

public class Example {
    public static void main(String[] args) {
        BaseClient client = BaseClient
            .builder()
            .token("<token>")
            .build();

        client.service().hello();
    }
}

